  "text" : "(\uB9AC\uD2B8\uC717 \uAD00\uB828) \uACFC\uB3C4\uD558\uAC8C \uC81C\uD55C\uD558\uC5EC \uCE68\uD574\uCD5C\uC18C\uC131 \uC6D0\uCE59\uC5D0 \uC704\uBC18\uB41C\uB2E4\uACE0 \uBCF4\uAE30\uB294 \uC5B4\uB835\uACE0, \uBC95\uC775\uC758 \uADE0\uD615\uC131\uB3C4 \uC778\uC815\uB41C\uB2E4. \uB530\uB77C\uC11C \uC774 \uC0AC\uAC74 \uBC95\uB960\uC870\uD56D\uC740 \uACFC\uC789\uAE08\uC9C0\uC6D0\uCE59\uC5D0 \uC704\uBC30\uB418\uC9C0 \uC544\uB2C8\uD55C\uB2E4. \uB2E4\uB9CC, \uC131\uAE30\uAD6C\uB97C \uC74C\uB780\uBB3C\uAC74\uC73C\uB85C \uBCF4\uC544 \uC720\uD1B5\uC744 \uAE08\uC9C0\uC2DC\uD0A4\uB294 \uAC83\uC740 \uAC1C\uC778\uC758 \uC740\uBC00\uD55C \uC0AC\uC801 \uC601\uC5ED\uC5D0",
