  "text" : "\uC77C\uBC18\uC778\uC774 \uC54C\uAE30 \uD798\uB4E0 \uD45C\uD604\uACFC \uC6A9\uC5B4\uB97C \uACE0\uC9D1\uD558\uB294 \uBC95\uB960\uAC00\uB4E4\uACFC \uBC95 \uBB38\uC5B8\uC744 \uBCFC \uB54C\uB9C8\uB2E4 \uC18C\uC218\uC758 \uADC0\uC871\uACFC \uC131\uC9C1\uC790\uB9CC\uC774 \uC77D\uC744 \uC218 \uC788\uC5C8\uB2E4\uB294 \uB3C5\uC77C \uC885\uAD50\uAC1C\uD601 \uC774\uC804\uC758 \uB77C\uD2F4\uC5B4 \uC131\uC11C\uAC00 \uC0DD\uAC01\uB09C\uB2E4. \uC131\uC9C1\uC790\uB4E4\uC740 \uC774\uB97C \uC545\uC6A9\uD558\uC5EC, \uC77C\uBC18 \uC2E0\uC790\uB4E4\uC744 \uC790\uC2E0\uB4E4\uC758 \uBAA9\uD68C\uC801 \uD544\uC694\uC5D0 \uB530\uB77C \uC870\uC885\uD588\uC5C8\uB2E4\uC9C0..",
