  "text" : "\uBA74\uCC45\uC774 \uB420 \uC218\uB3C4 \uC788\uB294 \uAD6C\uC870\uB77C\uACE0 \uC0DD\uAC01\uD558\uC2DC\uBA74 \uB429\uB2C8\uB2E4. \uADF8\uB0E5 \uC0C1\uC2DD\uC801\uC73C\uB85C \uC0DD\uAC01\uD588\uC744 \uB54C \uC790\uC2E0\uC758 \uD589\uC704\uAC00 \uC800\uC791\uAD8C\uC790\uC758 \uC800\uC791\uAD8C\uACFC \uC800\uC791\uBB3C\uC758 \uAC00\uCE58, \uC774\uC775 \uB4F1\uC744 \uCE68\uD574\uD558\uB294 \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uB418\uBA74 \uD558\uC9C0 \uC54A\uB294 \uAC83\uC774 \uC548\uC804\uBE75..\n\n\uC601\uD654\uC0AC\uC9C4 \uC62C\uB9AC\uBA74\uC11C \uC2A4\uD3EC \uD558\uB294 \uAC83\uB3C4 \uC5C4\uBC00\uD788 \uB9D0\uD558\uBA74 \uCE68\uD574..",
