  "text" : "\uC774\uC6A9\uC740 \uD5C8\uC6A9\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uB530\uB77C\uC11C \uB4DC\uB77C\uB9C8\uB098 \uC601\uD654 \uB4F1\uC758 \uCEA1\uCCD0\uD654\uBA74(or \uC2A4\uD2F8\uCEF7)\uC744 \uC778\uD130\uB137\uC5D0 \uAC8C\uC2DC\uD558\uB294 \uD589\uC704\uB294 \uC6D0\uCE59\uC801\uC73C\uB85C \uC800\uC791\uAD8C \uCE68\uD574\uC774\uC9C0\uB9CC, \uC77C\uC815\uD55C \uC694\uAC74(\uADF8\uC5D0 \uB300\uD55C \uBE44\uD3C9\u00B7\uAC10\uC0C1\uC774 \uC8FC\uAC00 \uB418\uBA70 \uCD9C\uCC98\uD45C\uC2DC\uB97C \uD558\uACE0, \uC800\uC791\uBB3C\uC758 \uAC00\uCE58\uB098 \uC774\uC775\uC744 \uC800\uD574\uD558\uC9C0 \uC54A\uC744 \uAC83)\uC744 \uAC16\uCD94\uBA74",
