  "text" : "\uADF8\uB807\uAC8C \uC6C5\uC5BC\uB300\uAE30 \uC2DC\uC791\uD558\uBA74 \uC810\uC810 \uBAA9\uC18C\uB9AC\uB97C \uC904\uC774\uAE30 \uC2DC\uC791\uD55C\uB2E4. \uADF8\uB7EC\uB2E4 \uC0C1\uB300\uD3B8\uC774 \uC0C8\uADFC\uC0C8\uADFC \uC228\uC18C\uB9AC\uB97C \uB0B4\uBA70 \uC7A0\uB4E4\uBA74 \uBC14\uB85C \uB04A\uC9C0 \uC54A\uACE0 \uD55C\uB450\uC2DC\uAC04 \uC815\uB3C4\uB294 \uADF8 \uC18C\uB9AC\uB97C \uB4E3\uACE0 \uC788\uB294 \uD3B8\uC774\uB2E4. \uBC14\uB85C \uB04A\uC73C\uBA74 \uC7A0\uC774 \uAE68\uC5B4 \uB2E4\uC2DC \uC804\uD654\uB97C \uD574\uC624\uB294 \uACBD\uC6B0\uB3C4 \uC788\uACE0, \uADF8 \uC228\uC18C\uB9AC \uB4E3\uB294\uAC8C \uC88B\uC544\uC11C..",
