  "text" : "\uC624\uB298 \uD310\uACB0\uB85C \uACE0\uC778\uC758 \uC601\uBA74\uACFC \uB3D9\uACE0\uB3D9\uB77D\uD55C \uBD80\uB300\uC6D0 \uBAA8\uB450\uAC00 \uC601\uD63C\uC758 \uC548\uC2DD\uC744 \uCC3E\uAE30\uB97C \uD76C\uB9DD\uD558\uACE0 \uAD70\uB300\uB0B4 \uC81C\uB3C4\uAC1C\uC120\uC73C\uB85C \uC774\uC5B4\uC9C0\uAE30\uB97C \uD76C\uB9DD\uD558\uBA70, \uC720\uC871\uB4E4\uB3C4 \uC774\uC81C\uB294 \uC2EC\uC801 \uACE0\uD1B5\uC5D0\uC11C \uD574\uBC29\uB418\uAE30\uB97C \uAC10\uD788 \uAD8C\uC720 \uB4DC\uB9BD\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uB2F9\uC0AC\uC790\uB294 \uB300\uBC95\uC6D0\uC5D0 \uAC00\uC11C \uD55C \uBC88 \uB354 \uD310\uB2E8 \uBC1B\uC544 \uBCF4\uAE30\uB97C..",
