  "text" : "\uC0AC\uC548\uC5D0 \uB530\uB77C\uC11C\uB294 \uB2F9 \uD310\uACB0\uC758 \uACB0\uACFC\uAC00 \uC2E4\uCCB4\uC801 \uC9C4\uC2E4\uC5D0 \uBC18\uD560 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC, \u201C\uC99D\uAC70\uC7AC\uD310\uC8FC\uC758\u201D\uC758 \uB300\uC6D0\uCE59\uC744 \uBC95\uAD00\uC740 \uD3EC\uAE30\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4. \uADF8\uB807\uAE30\uC5D0 \uC774 \uC0AC\uAC74\uC740 \uC77C\uCCB4\uC758 \uC120\uC785\uACAC\uC774\uB098 \uC774\uB150\uAC1C\uC785\uC744 \uBC30\uC81C\uD558\uACE0 '\uC99D\uAC70\uC7AC\uD310\uC8FC\uC758'\uC5D0 \uC785\uAC01\uD558\uC5EC \uD310\uB2E8\uD558\uC600\uC74C\uC744 \uBC1D\uD799\uB2C8\uB2E4.",
