  "text" : "\uC800\uBC88\uC5D0\uB3C4 \"\uBBF8\uC131\uB144\uC790\uB294 \uC0AC\uB78C\uC744 \uD328\uC8FD\uC5EC\uB3C4 \uC0AC\uB78C\uC744 \uCC98\uBC8C\uBC1B\uC9C0 \uC54A\uC73C\uBA70, \uC815\uB2F9\uBC29\uC704\uB97C \uC778\uC815\uD574 \uC8FC\uC9C0 \uC54A\uC73C\uBBC0\uB85C \uC0C1\uB300\uAC00 \uB54C\uB9AC\uB354\uB77C\uB3C4 \uAC00\uB9CC\uD788 \uB9DE\uACE0\uB9CC \uC788\uC5B4\uC57C \uD55C\uB2E4.\" \uB77C\uB294 \uB9D0\uB3C4 \uB418\uC9C0 \uC54A\uB294 \uD2B8\uC717\uC774 \uD55C\uCC3D \uB9AC\uD2B8\uC717 \uB418\uC5C8\uC744 \uB54C \uC5BC\uB9C8\uB098 \uD669\uB2F9\uD588\uB294\uB370.. \uADFC\uAC70 \uC5C6\uB294 \uC704\uD5D8\uD55C \uC720\uC5B8\uBE44\uC5B4\uB294 \uADF8\uB9CC-",
