  "text" : "\uAD70 \uC218\uC0AC\uAE30\uAD00\uC774 \uC774\uB97C \uBC1D\uD788\uAE30 \uC704\uD55C \uC5B4\uB5A0\uD55C \uB178\uB825\uB3C4 \uD558\uC9C0 \uC54A\uC740 \uCC44 \uC131\uAE09\uD558\uAC8C \uC790\uC0B4\uB85C \uACB0\uB860\uC9C0\uC5B4 \uC720\uC871\uC5D0\uAC8C \uC815\uC2E0\uC801 \uACE0\uD1B5\uC744 \uC785\uD614\uC73C\uBBC0\uB85C, \uAD6D\uAC00\uB294 \uC720\uC871\uC5D0\uAC8C \uBD80\uC2E4 \uC218\uC0AC\uC5D0 \uB300\uD55C \uC704\uC790\uB8CC  3\uC5B5\uC6D0\uC744 \uC9C0\uAE09\uD574\uC57C \uD55C\uB2E4. (\uC11C\uC6B8\uACE0\uBC95 2013. 8. 22, 2010\uB09830166)",
