  "text" : "\uC774\uB3D9\uB410\uB2E4\uACE0 \uBCF4\uAE30 \uC5B4\uB835\uB2E4. \uB2E4\uB9CC, \uC678\uBD80\uC640 \uC5C4\uACA9\uD788 \uACA9\uB9AC\uB41C \uAD70\uB300 \uB0B4 \uC0AC\uACE0\uC5D0 \uB300\uD574 \uAD70 \uC218\uC0AC\uAE30\uAD00\uC758 \uC2E4\uCCB4\uC801 \uC9C4\uC2E4 \uADDC\uBA85 \uC758\uBB34\uB294 \uC77C\uBC18 \uC218\uC0AC\uAE30\uAD00\uBCF4\uB2E4 \uB354 \uB192\uC544 \uD53C\uD574\uC790\uC758 \uC720\uC871\uB4E4\uC5D0\uAC8C\uB294 \uCCA0\uC800\uD55C \uC870\uC0AC\uB97C \uC694\uAD6C\uD560 \uAD8C\uB9AC\uAC00 \uC788\uB2E4. \uD0C0\uC0B4\uC774 \uC544\uB2CC\uC9C0 \uC758\uC2EC\uD560 \uB9CC\uD55C \uD569\uB9AC\uC801\uC778 \uC774\uC720\uAC00 \uC788\uC5C8\uC74C\uC5D0\uB3C4",
