  "text" : "\uC54C\uBAB8\uC218\uC0C9\uC744 \uC2E4\uC2DC\uD588\uB358 \uB2F9\uC2DC\uC5D0\uB294 \uBC94\uC8C4\uC790\uC758 \uC131\uAE30\uBCC0\uD615 \uC5EC\uBD80\uB098 \uBB38\uC2E0 \uC5EC\uBD80\uC5D0 \uB300\uD55C \uC870\uC0AC\uAC00 \uC798 \uC9D1\uACC4\uB418\uC5C8\uB2E4\uACE0 \uD558\uB294\uB370, \uC694\uC998\uC740 \uC54C\uBAB8\uC218\uC0C9\uC774 \uC5C6\uC5B4\uC11C..\n\n(\uACFC\uAC70 \uD1B5\uACC4\uB97C \uBCF4\uBA74 \uAD50\uB3C4\uC18C \uC7AC\uC18C\uC790\uC758 \uC57D 27%\uAC00 \uC131\uAE30\uBCC0\uD615\uC744 \uD588\uC5C8\uB2E4\uACE0 \uD569\uB2C8\uB2E4)",
