  "text" : "\uC608\uC804\uC5D0\uB294 \uAD50\uB3C4\uC18C(\uB610\uB294 \uC18C\uB144\uC6D0)\uC5D0 \uC785\uC18C\uC2DC \uC54C\uBAB8\uC73C\uB85C \uC218\uC0C9\uC744 \uD588\uC5C8\uC8E0. \uBC18\uC785\uAE08\uC9C0 \uBB3C\uD488\uC744 \uD56D\uBB38 \uB4F1\uC5D0 \uB123\uC5B4\uC11C \uB4E4\uC5EC\uC62C \uC6B0\uB824\uAC00 \uC788\uB2E4\uB294 \uC774\uC720\uC5D0\uC11C\uC600\uB294\uB370, \uC2E4\uC81C \uC801\uBC1C\uB418\uB294 \uC0AC\uB840\uB3C4 \uC801\uACE0 \uAD6D\uAC00\uC778\uAD8C\uC704\uC758 \uAD8C\uACE0\uB3C4 \uC788\uACE0 \uD574\uC11C \uC774\uC81C\uB294 \uC18D\uC637\uACFC \uAC00\uC6B4\uC744 \uC785\uD78C \uCC44 \uC804\uC790\uC601\uC0C1 \uAC80\uC0AC\uAE30\uB85C \uAC80\uC0AC..",
