  "text" : "\uD2B9\uD788 \uBBFC\uC871\uAC04\uC758 \uAC10\uC815 \uB4F1\uC774 \uACB0\uD569\uB420 \uC6B0\uB824\uAC00 \uC788\uB294 \uAE00\uB4E4\uC740 \uC77C\uB2E8 \uC548\uBBFF\uACE0 \uBD05\uB2C8\uB2E4. \uD6C4\uCFE0\uC2DC\uB9C8 \uBC29\uC0AC\uB2A5 \uC720\uCD9C \uB54C\uBB38\uC5D0 \uB3CC\uC5F0\uBCC0\uC774\uAC00 \uB418\uC5C8\uB2E4\uB294 \uC0DD\uBB3C\uB4E4\uC758 \uC0AC\uC9C4\uC774\uB098 '\uC77C\uBCF8\uC740 \uB9DD\uD588\uB2E4' \uB958\uC758 \uAE00\uB4E4, \uB610\uB294 \uC870\uC120\uC871\uC774\uB098 \uC911\uAD6D\uC778\uC758 \uAD6D\uB0B4 \uBC94\uC8C4\uC640 \uAD00\uB828\uB41C \uAE00\uB4E4\uC774 \uC77C\uB2E8.\uC758\uC2EC\uD574\uBD10\uC57C \uD560 \uAE00\uB4E4\uC774\uC8E0.",
