  "text" : "\uC608. \uC800\uB3C4 \uC9C1\uC811 \uBCF8 \uC801\uC774 \uC788\uC5B4\uC694. \uC2E0\uC0C1\uACF5\uAC1C\uB41C \uC131\uBC94\uC8C4\uC790\uC5D0 \uB300\uD55C \uD5D8\uB2F4\uC774 \uD53C\uD574\uC790\uC758 \uC2E0\uC0C1\uACF5\uAC1C\uC640 \uD53C\uD574\uC790\uC5D0 \uB300\uD55C \uD5D8\uB2F4\uC73C\uB85C \uC62E\uACA8\uAC00\uB294 \uACFC\uC815\uC744 \uB9D0\uC774\uC8E0. \uC2E0\uC0C1\uC774 \uACF5\uAC1C\uB418\uB294 \uC131\uBC94\uC8C4\uB294 \uC18C\uC544 \uBC0F \uC544\uB3D9 \uC131\uBC94\uC8C4\uC778\uB370- \uADF8\uB7F0 \uD53C\uD574\uC790\uC5D0\uAC8C\uC11C \uC6D0\uC778\uC744 \uCC3E\uC544\uB0B4\uACE0, \uC9D1\uAC12 \uD558\uB77D\uC744 \uAC71\uC815\uD558\uC2DC\uB354\uAD70\uC694.",
