  "text" : "\uC131\uBC94\uC8C4 \uD53C\uD574\uC790\uC5D0\uAC8C\uC11C '\uC131\uBC94\uC8C4 \uBC1C\uC0DD\uC758 \uC6D0\uC778(?)'\uC744 \uCC3E\uC544\uB0B4\uACE0\uC57C \uB9C8\uB294 \uC694\uC0C1\uD55C \uBB38\uD654(?)\uAC00 \uC544\uC9C1\uB3C4 \uD6A1\uD589\uD55C\uB370, \uC0AC\uB78C\uB4E4\uC774 \"\uAC00\uD574\uC790\uC5D0\uAC8C \uC778\uAD8C\uC774 \uC5B4\uB528\uB0D0! \uD53C\uD574\uC790\uC758 \uC778\uAD8C\uC740?\" \uC774\uB7EC\uBA74\uC11C \uC2E0\uC0C1\uACF5\uAC1C\uB97C \uCC3E\uB294 \uAC83\uB3C4 \uC880.. \uC194\uC9C1\uD788 \uB2D8\uB4E4\uB3C4 \uAC00\uD574\uC790 \uD655\uC778\uD558\uB294 \uAC83\uC73C\uB85C \uC548\uB05D\uB098\uC2DC\uC796\uC544\uC694?",
