  "text" : "\uC2DC\uB9C8\uACFC\uC7A5\uC774\uC5C8\uB098? \uAC70\uAE30\uC5D0\uC11C \uD55C \uC5EC\uC790\uAC00 \uD588\uB358 \uB300\uC0AC\uAC00 \uBB34\uCC99 \uACF5\uAC10\uAC14\uC5C8\uB294\uB370, \uC815\uD655\uD558\uAC8C \uAE30\uC5B5\uC774 \uB098\uC9C8 \uC54A\uB124...\n\n\"\uC77C\uBCF4\uB2E4 \uC0AC\uB791\uC774 \uBA3C\uC800\uC778 \uB0A8\uC790\uB294 \uC2E0\uB8B0\uD560 \uC218 \uC5C6\uB2E4.\" \uC600\uB098",
