  "text" : "\uADF8\uB7EC\uBA74 \uC815\uB9D0 \uB108\uBB34 \uD53C\uACE4\uD558\uB2E4. \uB2E4\uB4E4 \uC790\uAE30\uC758 \uC77C\uACFC \uC0DD\uD65C\uC774 \uC788\uB294\uAC74\uB370, \uC4F8\uB370\uC5C6\uC774 \uADF8\uB7F0\uAC78\uB85C \uC695\uC2EC\uBD80\uB9AC\uC9C0 \uC54A\uC558\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uC790\uAE30\uAC00 \uC6D0\uD560 \uB54C, \uADF8\uB9AC\uACE0 \uD56D\uC0C1 \uC790\uAE30\uC5D0\uAC8C \uB9E4\uB2EC\uB824\uC11C \uB180\uC544\uC904 \uC0C1\uB300\uAC00 \uD544\uC694\uD558\uC2DC\uB2E4\uBA74 \uCC28\uB77C\uB9AC \uAC1C\uB098 \uACE0\uC591\uC774\uC640 \uAC19\uC740 \uBC18\uB824\uB3D9\uBB3C\uC744 \uB4E4\uC774\uC138\uC694. \uC804 \uADF8\uB7F0\uAC70 \u3134\u3134\uD574",
