  "text" : "\uCD5C\uB8E8\uC561 \uB4F1\uC758 \uD654\uD559\uC57D\uD488\uC744 \uC0AC\uC6A9\uD558\uB354\uB77C\uB3C4 \uC73C\uB97C \uC9D1\uD68C \uC2DC \uC2DC\uC704\uB300 \uAD00\uB9AC, \uC2DC\uC704\uB300 \uD1B5\uC81C\uB098 \uAC15\uC81C\uD574\uC0B0\uC744 \uC704\uD574\uC11C\uB294 \uC0AC\uC6A9\uD560 \uC218 \uC5C6\uACE0, \uD2B9\uC815 \uAC1C\uC778\uC774 \uC2EC\uAC01\uD55C \uBD88\uBC95\uD589\uC704\uB97C \uD558\uACE0 \uC788\uB294 \uACBD\uC6B0\uB098 \uCCB4\uD3EC\uB97C \uACA9\uB82C\uD558\uAC8C \uC800\uD56D\uD558\uB294 \uACBD\uC6B0\uC5D0\uB9CC \uC9C0\uD718\uAD00 \uC2B9\uC778\uC744 \uBC1B\uC544 \uADF8 \uAC1C\uC778\uC5D0\uAC8C \uCD5C\uC18C\uD55C\uC73C\uB85C \uC0AC\uC6A9\uD558\uC8E0.",
