  "text" : "\uC5C4\uACA9\uD558\uAC8C \uAE08\uC9C0\uD558\uACE0 \uC788\uACE0, \uC0B4\uC218\uCC28 \uC870\uCC28\uB3C4 \uC2DC\uC704\uB300 \uD1B5\uC81C, \uC2DC\uC704\uB300 \uBD09\uC1C4\uB098 \uAC15\uC81C\uD574\uC0B0\uC758 \uACBD\uC6B0\uC5D0\uB294 \uC0AC\uC6A9\uD560 \uC218 \uC5C6\uB3C4\uB85D \uADDC\uC815\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC6B0\uB9AC\uB098\uB77C\uC5D0\uC11C \uD754\uD558\uAC8C \uC0AC\uC6A9\uB418\uB294 \uC2DC\uC704\uB300 \uD1B5\uC81C \uD654\uD559\uC57D\uD488\uC758 \uACBD\uC6B0, \uD604\uC7A5\uC5D0 \uBC18\uB4DC\uC2DC \uC0AC\uACE0\uB97C \uB300\uBE44\uD55C \uC758\uB8CC\uC9C4\uC744 \uBC30\uCE58\uC2DC\uD0A4\uAE30\uAE4C\uC9C0 \uD558\uB294\uB370\uC694 \uBB58..",
