  "text" : "\uC9C8\uC11C\uC720\uC9C0\uC120 \uC790\uCCB4\uAC00 \uC9D1\uC2DC\uBC95 \uC81C13\uC870\uC5D0 \uB530\uB77C \uC9D1\uD68C \uBC0F \uC2DC\uC704\uC758 \uBCF4\uD638\uC640 \uACF5\uACF5\uC758 \uC9C8\uC11C \uC720\uC9C0\uB97C \uC704\uD558\uC5EC \uD544\uC694\uD558\uB2E4\uACE0 \uC778\uC815\uB420 \uB54C '\uCD5C\uC18C\uD55C\uC758 \uBC94\uC704\uB97C \uC815\uD558\uC5EC' \uC124\uC815\uB418\uC5B4\uC57C \uD558\uB294\uB370, \uC774 \uC810\uC774 \uC81C\uB300\uB85C \uC9C0\uCF1C\uC9C0\uACE0 \uC788\uB294\uC9C0\uC5D0 \uB300\uD574\uC11C\uB294 \uC758\uBB38 \uD22C\uC131\uC774\uC785\uB2C8\uB2E4. \uB610\uD55C \uC9C8\uC11C\uC720\uC9C0\uC120\uC758 \uCE68\uBC94 \uC2DC\uC5D0",
