  "text" : "\uC774\uCC98\uB7FC \uC9C8\uC11C\uC720\uC9C0\uC120\uC744 \uC774\uC6A9\uD55C \uACBD\uCC30\uC758 \uC9D1\uD68C\uD1B5\uC81C\uBC29\uBC95\uC740 \uBE44\uB2E8 \uC774\uBC88 \uB300\uD55C\uBB38 \uC0AC\uAC74 \uBFD0\uB9CC \uC544\uB2C8\uB77C, \uACFC\uAC70\uBD80\uD130 '\uC740\uBC00\uD558\uAC8C \uAFB8\uC900\uD558\uAC8C' \uC560\uC6A9(?)\uB418\uC5B4 \uC654\uB2E4\uACE0 \uC870\uC2EC\uC2A4\uB7FD\uAC8C \uC9C0\uC801\uD574 \uBD05\uB2C8\uB2E4. \uAFB8\uC900\uD788 \uC560\uC6A9\uB418\uC5B4 \uC628 \uB9CC\uD07C, \uAFB8\uC900\uD558\uAC8C \uC9C0\uC801\uB418\uAE30\uB3C4 \uD588\uC8E0. \uC774\uAC74 \uC815\uB9D0 \uBB38\uC81C\uAC00 \uC788\uB2E4\uACE0 \uBD05\uB2C8\uB2E4.",
