  "text" : "\uADF8\uB7FC\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uB300\uD55C\uBBFC\uAD6D \uACBD\uCC30\uC740 \uC9D1\uD68C \uBC0F \uC2DC\uC704\uC5D0 \uB300\uD55C \uC9C8\uC11C\uC720\uC9C0\uC120\uC744 \uC9C0\uB098\uCE58\uAC8C \uC881\uAC8C \uC124\uC815\uD558\uC5EC, (\uB9C8\uCE58 \uCD9C\uADFC\uAE38 \uC2E0\uB3C4\uB9BC\uC5ED\uC5D0\uC11C \uB0B4 \uC758\uC9C0\uC640\uB294 \uC0C1\uAD00\uC5C6\uC774 \uD729\uC4F8\uB824 \uB2E4\uB2C8\uB4EF\uC774) \uC9D1\uD68C\u00B7\uC2DC\uC704 \uCC38\uAC00\uC790\uB4E4\uC774 \uC9C8\uC11C\uC720\uC9C0\uC120\uC5D0 \uD544\uC5F0\uC801\uC73C\uB85C \uCDA9\uB3CC\uC744 \uD560 \uC218 \uBC16\uC5D0 \uC5C6\uB3C4\uB85D \uC720\uB3C4\uD558\uB294 \uAC83 \uAC19\uC544\uC694.",
